# Gorny, Tuymazinsky District, Republic of Bashkortostan

}}
Gorny () is a rural locality (a village) in Starotuymazinsky Selsoviet, Tuymazinsky District, Bashkortostan, Russia. The population was 292 as of 2010. There are 6 streets.
Geography
Gorny is located 10 km southwest of Tuymazy (the district's administrative centre) by road. Starye Tuymazy is the nearest rural locality.
